import React from 'react';
import { Switch } from 'react-router-dom';

import { agentPlatformRoute } from 'app/shared/constant';
import { DefaultFrame, PublicFrame } from 'app/shared/component';
import {
  AccountInfoContainer,
  ForgotPasswordContainer,
  VerifyEmailContainer,
  RegisterContainer,
  NewPasswordContainer
} from 'app/module/account';
import i18next from 'app/shared/locales';

const AccountRoutes = () => (
  <Switch>
    <DefaultFrame exact path={agentPlatformRoute.AccountInfo} component={AccountInfoContainer} title={i18next.t('page.title.ai')} />
    <PublicFrame exact path={agentPlatformRoute.AccountForgotPassword} component={ForgotPasswordContainer} />
    <PublicFrame exact path={agentPlatformRoute.AccountVerifyEmail} component={VerifyEmailContainer} />
    <PublicFrame exact path={agentPlatformRoute.AccountNewPassword} component={NewPasswordContainer} />
    <PublicFrame exact path={agentPlatformRoute.Register} component={RegisterContainer} />
  </Switch>
);

export default AccountRoutes;
